//     return (
//         <nav>
//             <Link to="/userProfile"> <button>Show Profile</button></Link>
//             <br></br>
//             <Link to="/searchProducts"><button>Search products</button></Link>
//             <br></br>
//             <Link to="/cart"><button>Go to cart </button></Link>
//         </nav>
//     );
// };

// export default NavbarHome;



import React from 'react';
import { Link } from 'react-router-dom';

const NavbarHome = () => {
    return (
        <nav className="navbar navbar-expand-lg bg-body-tertiary">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">Navbar</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <Link className="nav-link" to="/userProfile">Show Profile</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/searchProducts">Search products</Link>
                        </li>
                        <li className="nav-item">
                            <Link className="nav-link" to="/cart">Go to cart</Link>
                        </li>
                    </ul>
                </div>
            </div>
        </nav>
    );
};

export default NavbarHome;
